import styled from 'styled-components';

export const Container = styled.div`
    display: grid;

    grid-template-columns: 1fr 1fr;
    grid-template-rows: auto 6rem;
    grid-template-areas:
        'Main Hero'
        'Footer Footer';
`;

export const Main = styled.div`

    img {
        width: 3rem;
        height: 3rem;
    }
`;

export const Title = styled.div``;
